import youtube from 'youtube-api';

export default async (req, res) => {
	const {
		query: { id },
	} = req;

	const secrets = {
		key: 'AIzaSyAjrLNmU6IY5s7dRF4L1EkIbEkg-nmbKrE',
		pageToken: 'AIzaSyBN9bCyequaW_iJRxEkd14leXW2f9Cw71Q',
		channelId: 'UCQ_dGc7VM1kYl19K0viWW4A',
	};

	const { pageToken, channelId } = secrets;

	const videos = await youtube.videos.list(
		{
			id,
			part: 'snippet',
		},
		(err, data) => resolve(data),
	);

	const playlists = await youtube.playlists.list({
		type: 'video',
		part: 'snippet',
		pageToken: pageToken,
		maxResults: 50,
		channelId: channelId,
	});

	console.log({ videos });

	res.json({ videos });
};
